    <>
    <div style={{ backgroundImage: `url(${background})` }}>
      Hello World
    </div>

    <Router>

      <Navbar/>

      <Switch>
        <Route exact path ="/" element ={<Home/>}>
        {
            user && user._id ? <Home/> : <login setLoginUser={setLoginUser}/>
          }
          </Route>
      <Route path ="/Login" element ={<Login/>}>
